import React from "react";
import '../components/VideoSummary.scss';

export default function Card(videos) {
    return (
    <div className="next-videos__card">
        <img src={videos.image} className="next-videos__card--image" alt={videos.title}/>
        <div className="next-videos__card--details">
            <h3 className="next-videos__card--title">{videos.title}</h3>
            <h4 className="next-videos__card--channel">{videos.channel}</h4>
        </div>
    </div>
    );
}
